import './styles.css';

function Navbar() {

    return (
        <div>
            <h4>Carros Top</h4>

            <button
                className="navbar-toggler"
                type="button"
                data-bs-toggle="collapse"
                data-bs-target="#dscatalog-navbar"
                aria-controls="dscatalog-navbar"
                aria-expanded="false"
                aria-label="Toggle navigation"
            >
                <span className="navbar-toggler-icon"></span>
            </button>
        </div>
    );
}

export default Navbar;
